import axios from 'axios';
import {
  Activity, CheckCircle2, ChevronRight, Dna,
  Dumbbell, Info,
  Pill, Search,
  ShieldAlert, ShieldCheck, Stethoscope,
  Utensils,
  X
} from 'lucide-react';
import { useEffect, useState } from 'react';

const API_BASE = "http://127.0.0.1:8000";

export default function ModernPredictor() {
  const [symptoms, setSymptoms] = useState([]);
  const [selected, setSelected] = useState([]);
  const [searchTerm, setSearchTerm] = useState("");
  const [results, setResults] = useState(null);
  const [isAnalyzing, setIsAnalyzing] = useState(false);

  useEffect(() => {
    axios.get(`${API_BASE}/symptoms`)
      .then(res => setSymptoms(res.data.symptoms || []))
      .catch(err => console.error("Backend unreachable. Check FastAPI."));
  }, []);

  const toggleSymptom = (s) => {
    setSelected(prev => prev.includes(s) ? prev.filter(i => i !== s) : [...prev, s]);
  };

  const runAnalysis = async () => {
    if (selected.length === 0) return;
    setIsAnalyzing(true);
    try {
      const res = await axios.post(`${API_BASE}/predict`, { symptoms: selected });
      setResults(res.data);
      window.scrollTo({ top: 0, behavior: 'smooth' }); // Focus user on results
    } catch (err) {
      alert("Analysis Failed: Check if backend is running.");
    } finally {
      setIsAnalyzing(false);
    }
  };

  return (
    <div className="min-h-screen bg-[#F8FAFC] text-[#1E293B] font-sans antialiased">
      {/* Dynamic Header */}
      <nav className="sticky top-0 z-50 bg-white/80 backdrop-blur-md border-b border-slate-200">
        <div className="max-w-7xl mx-auto px-4 sm:px-6 lg:px-8 h-16 flex justify-between items-center">
          <div className="flex items-center gap-2">
            <div className="p-2 bg-indigo-600 rounded-lg">
              <Dna size={20} className="text-white" />
            </div>
            <span className="font-bold text-xl tracking-tight">NeuroDiagnostic <span className="text-indigo-600">AI</span></span>
          </div>
          <div className="hidden md:flex items-center gap-4">
            <span className="flex items-center gap-1.5 text-xs font-semibold text-green-600 bg-green-50 px-3 py-1 rounded-full border border-green-100">
              <div className="w-1.5 h-1.5 bg-green-500 rounded-full animate-pulse" />
              RF-MODEL v2.4
            </span>
          </div>
        </div>
      </nav>

      <main className="max-w-7xl mx-auto px-4 sm:px-6 lg:px-8 py-8">
        <div className="grid lg:grid-cols-12 gap-8">

          {/* Left: Input Panel */}
          <div className="lg:col-span-5 space-y-6">
            <div className="bg-white rounded-3xl p-6 shadow-sm border border-slate-200">
              <h2 className="text-2xl font-bold mb-1">Symptom Input</h2>
              <p className="text-slate-500 text-sm mb-6">Select all that apply for clinical correlation.</p>

              <div className="relative mb-6">
                <Search className="absolute left-4 top-1/2 -translate-y-1/2 text-slate-400" size={18} />
                <input 
                  type="text" 
                  placeholder="Type to filter symptoms..." 
                  className="w-full pl-11 pr-4 py-3 bg-slate-50 border border-slate-200 rounded-xl focus:ring-2 focus:ring-indigo-500/20 focus:border-indigo-500 transition-all outline-none"
                  onChange={(e) => setSearchTerm(e.target.value)}
                />
              </div>

              <div className="h-[400px] overflow-y-auto pr-2 space-y-1 custom-scrollbar">
                {symptoms.filter(s => s.toLowerCase().includes(searchTerm.toLowerCase())).map(s => {
                  const isActive = selected.includes(s);
                  return (
                    <button
                      key={s}
                      onClick={() => toggleSymptom(s)}
                      className={`w-full flex items-center justify-between p-3 rounded-xl text-sm font-medium transition-all ${
                        isActive ? 'bg-indigo-600 text-white shadow-md' : 'hover:bg-slate-50 text-slate-600 border border-transparent hover:border-slate-200'
                      }`}
                    >
                      <span className="capitalize">{s.replace(/_/g, ' ')}</span>
                      {isActive ? <X size={16} /> : <div className="w-4 h-4 border-2 border-slate-200 rounded-full" />}
                    </button>
                  );
                })}
              </div>

              <button 
                onClick={runAnalysis}
                disabled={selected.length === 0 || isAnalyzing}
                className="w-full mt-6 py-4 bg-slate-900 text-white rounded-2xl font-bold hover:bg-slate-800 disabled:opacity-30 transition-all flex items-center justify-center gap-2"
              >
                {isAnalyzing ? "Processing Data..." : "Generate Diagnosis"}
                {!isAnalyzing && <ChevronRight size={18} />}
              </button>
            </div>
          </div>

          {/* Right: Results Panel */}
          <div className="lg:col-span-7">
            {!results && !isAnalyzing ? (
              <div className="h-full min-h-[500px] bg-slate-50 border-2 border-dashed border-slate-200 rounded-3xl flex flex-col items-center justify-center p-12 text-center">
                <div className="w-16 h-16 bg-white rounded-2xl shadow-sm flex items-center justify-center mb-4">
                  <Activity className="text-slate-300" size={32} />
                </div>
                <h3 className="text-lg font-semibold text-slate-900">Waiting for Data</h3>
                <p className="text-slate-500 max-w-xs text-sm">Select symptoms from the left panel and click 'Generate Diagnosis' to see AI predictions.</p>
              </div>
            ) : isAnalyzing ? (
                <div className="space-y-4 animate-pulse">
                    <div className="h-32 bg-slate-200 rounded-3xl" />
                    <div className="grid grid-cols-2 gap-4">
                        <div className="h-40 bg-slate-200 rounded-3xl" />
                        <div className="h-40 bg-slate-200 rounded-3xl" />
                    </div>
                </div>
            ) : (
              <div className="space-y-6 animate-in fade-in slide-in-from-right-4 duration-500">
                {/* Result Header */}
                <div className="bg-white rounded-3xl p-8 shadow-sm border border-slate-200 relative overflow-hidden">
                  <div className="relative z-10">
                    <div className="flex items-center gap-2 text-indigo-600 mb-2">
                        <Stethoscope size={20} />
                        <span className="text-xs font-black uppercase tracking-widest">Primary Diagnosis</span>
                    </div>
                    <h1 className="text-4xl font-bold text-slate-900 mb-4">{results.disease}</h1>
                    <div className="flex items-start gap-3 p-4 bg-slate-50 rounded-2xl border border-slate-100">
                        <Info size={18} className="text-slate-400 mt-1 shrink-0" />
                        <p className="text-slate-600 text-sm leading-relaxed">{results.description}</p>
                    </div>
                  </div>
                </div>

                {/* Treatment Grid */}
                <div className="grid md:grid-cols-2 gap-6">
                  {/* Medications */}
                  <div className="bg-white rounded-3xl p-6 shadow-sm border border-slate-200">
                    <div className="flex items-center gap-2 mb-4 text-rose-500">
                      <Pill size={18} />
                      <h3 className="font-bold">Medical Treatment</h3>
                    </div>
                    <div className="space-y-2">
                      {results.medications?.map((m, i) => (
                        <div key={i} className="px-4 py-3 bg-rose-50 text-rose-700 rounded-xl text-xs font-bold border border-rose-100 italic">
                          {m}
                        </div>
                      ))}
                    </div>
                  </div>

                  {/* Precautions */}
                  <div className="bg-white rounded-3xl p-6 shadow-sm border border-slate-200">
                    <div className="flex items-center gap-2 mb-4 text-emerald-500">
                      <ShieldCheck size={18} />
                      <h3 className="font-bold">Precautions</h3>
                    </div>
                    <ul className="space-y-3">
                      {results.precautions?.map((p, i) => (
                        <li key={i} className="flex gap-2 text-sm text-slate-600 leading-snug">
                          <CheckCircle2 size={16} className="text-emerald-500 shrink-0 mt-0.5" />
                          {p}
                        </li>
                      ))}
                    </ul>
                  </div>

                  {/* Diets (New) */}
                  <div className="bg-white rounded-3xl p-6 shadow-sm border border-slate-200">
                    <div className="flex items-center gap-2 mb-4 text-amber-500">
                      <Utensils size={18} />
                      <h3 className="font-bold">Dietary Plan</h3>
                    </div>
                    <div className="flex flex-wrap gap-2">
                        {results.diets?.map((d, i) => (
                            <span key={i} className="px-3 py-1.5 bg-amber-50 text-amber-700 rounded-lg text-xs font-bold border border-amber-100 capitalize">
                                {d}
                            </span>
                        ))}
                    </div>
                  </div>

                  {/* Workout (New) */}
                  <div className="bg-white rounded-3xl p-6 shadow-sm border border-slate-200">
                    <div className="flex items-center gap-2 mb-4 text-blue-500">
                      <Dumbbell size={18} />
                      <h3 className="font-bold">Activity Recommendation</h3>
                    </div>
                    <p className="text-sm text-slate-600 bg-blue-50 p-4 rounded-xl border border-blue-100 leading-relaxed font-medium">
                        {results.workout}
                    </p>
                  </div>
                </div>

                {/* Warning */}
                <div className="bg-amber-50 border border-amber-200 rounded-2xl p-4 flex gap-3 items-center">
                    <ShieldAlert className="text-amber-600 shrink-0" size={20} />
                    <p className="text-[11px] text-amber-800 font-medium">
                        <b>DISCLAIMER:</b> This is an automated classification. This tool does not replace professional medical judgment. If symptoms persist or worsen, seek immediate clinical attention.
                    </p>
                </div>
              </div>
            )}
          </div>
        </div>
      </main>
    </div>
  );
}
